import React from "react";
import styled from "styled-components";

const Container = styled.footer.attrs({ className: "w-full" })`
  background: #222;
  margin: 120px 0 0;

  @media (min-width: 620px) {
    padding: 40px 0 60px;
  }

  @media (min-width: 1020px) {
    padding: 50px 0 100px;
  }

  @media (max-width: 619px) {
    margin-top: 0;
  }
`;

const UpperBlock = styled.div.attrs({ className: "" })`
  margin-left: auto;
  margin-right: auto;
  width: 100%;
  @media (min-width: 620px) {
    max-width: 1600px;
    padding-left: 80px;
    padding-right: 80px;
  }

  @media (min-width: 1020px) {
    max-width: 1684px;
    padding-left: 122px;
    padding-right: 122px;
  }
`;
const Footer = () => <Container>Footer Here</Container>;

export default Footer;
